{"operationName":"PublisherSidebarFollowsQuery","variables":{"userId":"e624226f22ea","limit":5},"query":"query PublisherSidebarFollowsQuery($userId: ID!, $limit: Int) {
  userFollows(userId: $userId, limit: $limit) {
    ... on User {
      hasDomain
      ...UserMentionTooltip_user
      ...PublisherSidebarFollows_followedEntity
      __typename
    }
    ... on Collection {
      ...CollectionTooltip_collection
      ...PublisherSidebarFollows_followedEntity
      __typename
    }
    __typename
  }
}

fragment UserMentionTooltip_user on User {
  id
  name
  username
  bio
  imageId
  mediumMemberAt
  socialStats {
    followerCount
    __typename
  }
  viewerEdge {
    id
    createdAt
    lastPostCreatedAt
    __typename
  }
  ...UserAvatar_user
  ...UserFollowButton_user
  __typename
}

fragment UserAvatar_user on User {
  __typename
  id
  imageId
  mediumMemberAt
  name
  username
  ...userUrl_user
}

fragment userUrl_user on User {
  __typename
  id
  customDomainState {
    live {
      domain
      __typename
    }
    __typename
  }
  hasSubdomain
  username
}

fragment UserFollowButton_user on User {
  ...UserFollowButtonSignedIn_user
  ...UserFollowButtonSignedOut_user
  __typename
  id
}

fragment UserFollowButtonSignedIn_user on User {
  id
  __typename
}

fragment UserFollowButtonSignedOut_user on User {
  id
  ...SusiClickable_user
  __typename
}

fragment SusiClickable_user on User {
  ...SusiContainer_user
  __typename
  id
}

fragment SusiContainer_user on User {
  ...SignInOptions_user
  ...SignUpOptions_user
  __typename
  id
}

fragment SignInOptions_user on User {
  id
  name
  __typename
}

fragment SignUpOptions_user on User {
  id
  name
  __typename
}

fragment CollectionTooltip_collection on Collection {
  id
  name
  description
  subscriberCount
  ...CollectionAvatar_collection
  ...CollectionFollowButton_collection
  __typename
}

fragment CollectionAvatar_collection on Collection {
  name
  avatar {
    id
    __typename
  }
  ...collectionUrl_collection
  __typename
  id
}

fragment collectionUrl_collection on Collection {
  id
  domain
  slug
  __typename
}

fragment CollectionFollowButton_collection on Collection {
  __typename
  id
  name
  canToggleEmail
  slug
  ...collectionUrl_collection
  ...SusiClickable_collection
}

fragment SusiClickable_collection on Collection {
  ...SusiContainer_collection
  __typename
  id
}

fragment SusiContainer_collection on Collection {
  name
  ...SignInOptions_collection
  ...SignUpOptions_collection
  __typename
  id
}

fragment SignInOptions_collection on Collection {
  id
  name
  __typename
}

fragment SignUpOptions_collection on Collection {
  id
  name
  __typename
}

fragment PublisherSidebarFollows_followedEntity on Publisher {
  __typename
  id
  name
  ...PublisherAvatar_publisher
}

fragment PublisherAvatar_publisher on Publisher {
  __typename
  ... on Collection {
    id
    ...CollectionAvatar_collection
    __typename
  }
  ... on User {
    id
    ...UserAvatar_user
    __typename
  }
}
"}
